import React, { Component, Fragment } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Card from "@material-ui/core/Card";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemAvatar from "@material-ui/core/ListItemAvatar";
import ListItemText from "@material-ui/core/ListItemText";
import Avatar from "@material-ui/core/Avatar";

import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import Chip from "@material-ui/core/Chip";
import FaceIcon from "@material-ui/icons/Face";
import DoneIcon from "@material-ui/icons/Done";
import { Timeline, Event } from "react-timeline-scribble";

import "./components.css";

export default class About extends Component {
  render() {
    const classes = makeStyles(theme => ({
      root: {
        flexGrow: 1
      },
      paper: {
        height: "500px"
      },
      skillsroot: {
        display: "flex",
        justifyContent: "center",
        flexWrap: "wrap"
      },
      chip: {
        margin: theme.spacing(1)
      }
    }));

    return (
      <div>
        <div class="about" id="about">
          <div className={classes.root}>
            <Grid container spacing={1}>
              <Grid item xs={4}>
                <Paper className={classes.paper}>
                  <Fragment>
                    <h1>EDUCATION</h1>
                    <Timeline>
                      <Card>
                        <Event
                          interval={"2013 – 2017"}
                          title={"Thomas Jefferson HSST"}
                          subtitle={"Student"}
                        >
                          <img
                            src={require("../images/tj.jpg")}
                            className="tjuva"
                          />
                        </Event>
                      </Card>
                      <Card className="education">
                        <Event
                          interval={"2017 – 2021"}
                          title={"University of Virginia"}
                          subtitle={"SEAS - Computer Science & Statistics"}
                        >
                          <img
                            src={require("../images/uva2.jpg")}
                            className="tjuva"
                          />
                        </Event>
                      </Card>
                    </Timeline>
                  </Fragment>
                </Paper>
              </Grid>
              {/*  */}
              <Grid item xs={4} md={4}>
                <Paper className={classes.paper}>
                  <div className={classes.root}>
                    <Grid container spacing={0}>
                      <h1>RELEVANT COURSES</h1>
                      <Grid item xs={6} md={6}>
                        <Typography variant="h6" className={classes.title}>
                          TJHSST
                        </Typography>
                        <List>
                          <ListItem>
                            <ListItemAvatar>
                              <img
                                src={require("../images/tj.jpg")}
                                className="avatar"
                              />
                            </ListItemAvatar>
                            <ListItemText primary="AP CS" />
                          </ListItem>
                          <ListItem>
                            <ListItemAvatar>
                              <img
                                src={require("../images/tj.jpg")}
                                className="avatar"
                              />
                            </ListItemAvatar>
                            <ListItemText primary="Artificial Intelligence" />
                          </ListItem>
                          <ListItem>
                            <ListItemAvatar>
                              <img
                                src={require("../images/tj.jpg")}
                                className="avatar"
